interface AccordionProps {
  accordionConfig: { title: string; content: string }[];
}

const getInitialState = (config: AccordionProps["accordionConfig"]) => {
  const initialState: Record<string, boolean> = {};
  config.forEach((item) => {
    initialState[item.title] = false;
  });
  return initialState;
};

